Plot (from the back of the DVD): 
The people of a rural Midwestern town go about their daily lives unaware something savage is among them, causing death... and the dead to walk.
I would like to add that the film is pretty original. It's kind of like Memento in that every section of the movie takes place before the previous section. This is no-budget indie film-making at its finest. 

Support the people that worked hard on this gem and buy the DVD! It's $16 which includes shipping, and mine came with the cover and DVD signed.
